Information
------------------------------

Drugs Inc: High Stakes Vegas
The gambling mecca Sin City plays host to has many as 40 million tourists a year. In storm drains beneath the Las Vegas strip, homeless addicts get high on crack in underground shanties, while in half-built suburbs, police battle marijuana gangs for control of the city's slum-hit homes. We'll meet a Vietnam veteran addicted to crack cocaine and living in a $20-a-day motel room. And, for tourists wanting a good time with a high,&quot; our cameras reveal a group of discreet go-to fixers.


